                WriteLiteral(@".The government announced on 2 February 2020 that all persons except Filipino citizens and permanent resident visa holders were temporarily barred from entering the country.A temporary ban on Filipinos from travelling to China or its special administrative region was also imposed. A mandatory 14-day quarantine for Filipinos returning to from China or its special administrative region was announced.Further, visa upon arrival for Chinese nationals has been temporarily suspended.The Philippines government issued a temporary ban on 26 February on all citizens from travelling to South Korea, as the country reported a spike in the number of confirmed cases.Further, people from the affected regions of South Korea including Gyeongbuk, Daegu and Cheongdo have been banned from entering into the country.</p>
                            <h4>Travel Safety:</h4>
                                    <p>Phillipines has Alert level 2 , Practice Enhanced Precautions and Watch Level 1, Practice Usual Precautions</p>
         ");
                WriteLiteral(@"               </section>

                         <section id = ""South Korea"" style=""background-image: url('https://bitcoinist.com/wp-content/uploads/2020/03/5-March-1-e1583425959333.jpg');"">                        
                            <h2>South Korea</h2>
                                <h4>First case:</h4>
                                    <p>On 20 January, the first confirmed case was identified as a 35-year-old Chinese woman. The first South Korean national to be infected occurred three days later was a 55-year-old man who worked in Wuhan and returned for a checkup with flu symptoms. The two infection reports were publicly released on 24 January.</p>

                             <h4>Goverment Response:</h4>
                                    <p>SEOUL, South Korea -- The South Korean government is offering ""emergency child care"" to parents dealing with the double challenge of school closures and work-at-home policies as the country battles to fight the fast-spreading novel coronavirus");
                WriteLiteral(@".Drastic measures are taking place this week which include the state subsidizing owners of small and medium-sized businesses so that they could provide flexible hours to employees who have family members to take care of.To limit mobility and human contact, the government has encouraged people to stay home, company offices that are at risk to be closed and public venues and events be canceled. All schools that should have started a new semester on March 2 are now postponed until March 22.The government will compensate business owners a maximum of about $5,000 for every employee per year according to the number of flexible work hours per week. In the event that an employee’s close relative falls ill, has an accident, or struggles due to old age, or that child care difficulties arise, he or she can take up to 10 days of unpaid leave from work.</p>
                            <h4>Travel Safety:</h4>
                                    <p>South Korea has a Warning Level 3, Avoid nonessential Travel due to COVID-");
                WriteLiteral(@"19 outbreak</p>
                        </section>


                         <section id = ""Singapore"" style="" background-image: url('https://newsroom.pinterest.com/sites/default/files/post_main_content_image/2019-07/Singapore%20Image%20Final_0.jpg');"">                        
                            <h2>Singapore</h2>
                                <h4>First case:</h4>
                                    <p>On 23 January, the first case in Singapore was confirmed, involving a 66-year-old Chinese national from Wuhan who flew from Guangzhou via China Southern Airlines flight CZ351 with nine companions. He stayed at Shangri-La's Rasa Sentosa Resort and Spa. Contact tracing subsequently commenced.</p>

                             <h4>Goverment Response:</h4>
                                    <p>Singapore is working 'round the clock' to find coronavirus cases. Lying about where you've been can result in 6 months of jail or a fine of up to $10,000.Anyone who catches COVID-19 in Singapore can exp");
                WriteLiteral(@"ect to answer a lot of questions about where they've been, and who they've met along the way.If they don't comply, people can be put in jail for months or subject to thousands of dollars in fines. That is how seriously the southeast Asian city-state of 6 million takes its disease contact tracing.""Contact tracing teams have been working round the clock"" for more than 13 hours a day, tracing back the steps of anyone who's contracted the novel coronavirus, a Singapore Ministry of Health spokesperson told Business Insider. In what appears to be a first, disease trackers in Singapore have used an experimental antibody test for COVID-19 to confirm that a suspected patient was infected with the coronavirus. The patient was one of two people who together formed a missing link between two clusters of cases that each occurred in a Singaporean church.</p>
                            <h4>Travel Safety:</h4>
                                    <p>There are no notices currently in effect for Singapore</p>
              ");
                WriteLiteral(@"          </section>


                         <section id = ""Taiwan"" style=""background-image: url('https://cdn.cnn.com/cnnnext/dam/assets/180719144431-beautiful-taiwan-golden-waterfalls-z-new-popu0406s.jpg');"">                        
                            <h2>Taiwan</h2>
                                <h4>First case:</h4>
                                    <p>On January 20, 2020, a 55-year-old woman who worked in Wuhan, China, arrived at Taiwan Taoyuan International Airport and presented to quarantine officials immediately, with a history of sore throat, dry cough, fatigue, and low-grade subjective fever since January 11, 2020.</p>

                             <h4>Goverment Response:</h4>
                                    <p>TTaiwanese health officials saw the virus taking shape in the central Chinese Wuhan in December and began checking passengers who flew in from there. They also cut off flights from much of China, the outbreak origin, before a lot of peers around Asia did.
         ");
                WriteLiteral(@"                           Now almost every public building in Taipei offers hand sanitizer and a lot of them, such as schools, require that anyone entering submit to a fever check. Taiwan's Centers for Disease Control announces any new cases every day. In February it began rationing facemask purchases to head off panic buying.Officials in Taiwan took a “more proactive” approach compared to other parts of Asia by stopping flights from China, lawmaker Lo Chih-cheng said. Hundreds of thousands of Taiwanese live in China and a lot of them return in the first two months of each year for holidays, a pattern that increased Taiwan’s exposure to the disease.</p>
                            <h4>Travel Safety:</h4>
                                    <p>There are no notices currently in effect for Taiwan.</p>
                        </section>


                         <section id = ""Vietnam"" style=""background-image: url('https://www.dailymaverick.co.za/wp-content/uploads/Mills-Lessons-from-Vietnam-MAIN-PHOTO-16");
                WriteLiteral(@"00x946.jpg');"">                        
                            <h2>Vietnam</h2>
                                <h4>First case:</h4>
                                    <p>On 23 January, Vietnam confirmed the first two cases of COVID-19, a Chinese man (#1) travelling from Wuhan to Hanoi to visit his son who lived in Vietnam, and his son (#2), who was believed to have contracted the disease from his father. They were hospitalised on 22 January at Chợ Rẫy Hospital, Ho Chi Minh City.[2] On 24 January, Acting Minister of Health Vũ Đức Đam ordered the activation of the Emergency Epidemic Prevention Centre.[3] On 29 January, the son fully recovered and was discharged.[4] His father was discharged on 12 February.</p>

                             <h4>Goverment Response:</h4>
                                    <p>Vietnam has prepared for the epidemic as early as the very first case in China emerged, around mid-December 2019. Vietnam's Deputy Prime Minister Vũ Đức Đam stated that the Government Office, Arm");
                WriteLiteral(@"y forces and Minister of Health have worked out various plans in case the number of affected cases burst out.Thanks to this nation-wide effort, the country has won the first fights against COVID-19 with 16 confirmed cases, 16 recoveries, and 0 death.Vietnamese response has gathered praises from several figures, comparing it to the fast Vietnamese response back in 2003 when the SARS outbreak occurred when Vietnam became the first country to be cleared of SARS. United States Ambassador to Vietnam, Daniel Kritenbrink, had praised Vietnam for its fast measures against the outbreak.U.S. delegation also praised Vietnam for its quarantine efforts, and have cooperated with the Vietnamese Embassy in the United States.</p>
                            <h4>Travel Safety:</h4>
                                    <p>There are no notices currently in effect for Vietnam</p>
